from typing import List


class Solution:
    def minimumAverageDifference(self, nums: List[int]) -> int:
        m = 9999999999999
        res = 0
        length = len(nums)
        s1 = 0
        s2 = sum(nums)
        for i in range(length):
            s1 += nums[i]
            s2 -= nums[i]
            ave1 = s1 // (i+1)
            if length - i - 1 == 0:
                ave2 = 0
            else:
                ave2 = s2 // (length - i - 1)
            if abs(ave1 - ave2) < m:
                res = i
                m = abs(ave1 - ave2)
        return res


